import ReactDOM from "react-dom";

const App = () => {
    return <h1>こんにちは！</h1>;
};
const AppHello = () => {
    return (
        <div>
        <h2>hello</h2>
        <p>お元気ですか？</p>
        </div>
    );
}

ReactDOM.render(<App />, document.getElementById("root"));
ReactDOM.render(<AppHello />,document.getElementById("hello"));
